import ProductCard from "../components/ProductCard";

const Shop = () => {

    return (
        <>
            <div className="content">
                <h1 className="center">This is the Shop</h1>
                <div className="prodlist">
                    <ProductCard />
                    <ProductCard />
                    <ProductCard />
                </div>
            </div>
        </>
    )
};

export default Shop;
